import React from 'react'
import './styles/App.css'
import TableHead from './components/TableHead.jsx'

function App() {
  return (
    <div className="App">
      <TableHead content={{id: 1, name: "Дата"}} />
      <TableHead content={"Название"} />
      <TableHead content={"Количество"} />
      <TableHead content={"Расстояние"} />
    </div>
  );
}

export default App;
